import React from "react";

const GetInTouch = () => {
  return (
    <div className="flex bg-[#115d9e] w-[1300px] h-[200px] mx-auto">
      <div className="flex flex-col">
        <span>Get In Touch</span>
        <span>Let's Talk Business</span>
      </div>
      <div>
        <button className="bg-[#FF004F] text-white px-4 py-2 rounded-md">
          Contact Now
        </button>
      </div>
    </div>
  );
};

export default GetInTouch;
